import React, { useState } from "react";
import PropTypes from 'prop-types';
import Info from "./Info";
import Main from "./pages/Main/Main";
import Tes from "./pages/Main/test";
import MovieDetails from "./MovieDetails";

function Movie({ moviecd, title, audiCnt, rank }) {
    const [showDetails, setShowDetails] = useState(false);
    const [test, settest] = useState(true);

    const handleShowDetails = () => {
        setShowDetails(true);
    };

    return (
        <div>
            <h2>영화제목: {title} {moviecd} </h2>
            <h4>관객수: {audiCnt}, 일간 박스오피스 랭킹: {rank}<br /><br /></h4>
            <button onClick={handleShowDetails}>상세정보</button>

            {showDetails && <MovieDetails moviecd={moviecd} />}

            {test ? <div>test값 true</div> : <Main moviecd2={moviecd} />}
        </div>
    );
}

Movie.propTypes = {
    title: PropTypes.string.isRequired
};

export default Movie;
